lass=\"ff_A sf_M wf_B\" colspan=\"2\">%nomecliente% - %cpfcnpjcliente%</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_P cell_5\">Local de Recebimento</td>\n				<td class=\"ff_A sf_P cell_1A\">Valor do Recibo</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_M wf_B\">%nomerecebedor%</td>\n				<td class=\"ff_A sf_M cell_3A wf_B\">R$ %valor%</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_P cell_5\">Em Data</td>\n				<td class=\"ff_A sf_P cell_1A\">Tipo do pagamento</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_M wf_B\">%data%</td>\n				<td class=\"ff_A sf_M cell_3A wf_B\">%tiporecebimento%</td>\n			</tr>\n			<tr>\n				<td class=\"ff_B sf_M cell_5 at_C\">\n				Data Recebido do Antendente:______/_____/_______\n				</td>\n				<td class=\"ff_B sf_M cell_5 at_R\">\n				N° %numero%\n				</td>\n			</tr>\n		</table>\n	</div>\n	<div class=\"corte_1 ff_B sf_P\">Corte na linha pontilhada</div>\n	<div class=\"tela\">\n		<table border=0 cellpading=\"0\" cellspacing=\"0\" width=\"100%\">\n			<tr>\n				<td class=\"ff_A sf_P\">Via Antendente (Nome Empresa)</td>\n				<td class=\"ff_A sf_P cell_3A\" width=\"70px\" colspan=\"2\">Data Movimentação</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_M wf_B\">%provedornome% - (%grupo%)</td>\n				<td class=\"ff_A sf_M cell_3A wf_B\" colspan=\"2\">%data%</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_P cell_5\" colspan=\"2\">Cliente</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_M wf_B\" colspan=\"2\">%nomecliente% - %cpfcnpjcliente%</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_P cell_5\" colspan=\"2\">Informações da Movimentação:</td>\n			</tr>\n			<tr>\n				<td class=\"ff_A sf_M wf_B\" valign=\"top\">\n					<table cellspacing=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n						<tr>\n							<th class=\"ff_A sf_M at_L wf_B\">Valor: <font class=\"wf_N\">%valor%</font></th>\n							<th class=\"ff_A sf_M at_L wf_B\">Tipo: <font class=\"wf_N\">%tiporecebimento%</font></th>\n						</tr>\n					</table>\n				</td>\n				<td class=\"ff_B sf_M at_R\">\n				N° %numero%\n				</td>\n			</tr>\n			<tr>\n				<td class=\"ff_B sf_M cell_5 at_C\" colspan=\"2\">\n				Pago p/ Empresa Em:______/_____/_______		Valor R$ ______________		Ass:________________________\n				</td>\n			</tr>\n		</table>\n	</div>', '<div class=\"quebrapagina\">\n<div style=\"border-right: medium none; padding-right: 0cm; border-top: medium none; padding-left: 0cm; padding-bottom: 1pt; border-left: medium none; padding-top: 0cm; border-bottom: 1pt solid\">\n<p class=\"MsoNormal\" style=\"border-right: medium none; padding-right: 0cm; border-top: medium none; padding-left: 0cm; padding-bottom: 0cm; border-left: medium none; padding-top: 0cm; border-bottom: medium none; text-align: center\" align=\"center\"><b><span style=\"font-size: 14pt; font-family: Verdana\">DECLARAÇÃO DE CONFORMIDADE DE PAGAMENTO</span></b><b><span style=\"font-size: 8pt; font-family: Verdana\"> </span></b></p>\n</div>\n<p style=\"text-align: center\" align=\"center\"><b><span style=\"font-size: 8pt; font-family: Verdana\">TERMO DE&nbsp;USO %termo%</span></b><strong><br>\n</strong></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">Eu, </span><b><span style=\"font-size: 9pt; font-family: Verdana\">%nomecliente%</span></b><span style=\"font-size: 9pt; font-family: Verdana\">, residente à </span><b><span style=\"font-size: 9pt; font-family: Verdana\">%enderecocliente%</span></b><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><b><span style=\"font-size: 9pt; font-family: Verdana\">%bairrocliente%</span></b><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><b><span style=\"font-size: 9pt; font-family: Verdana\">%cidadecliente% - %estadocliente%</span></b><span style=\"font-size: 9pt; font-family: Verdana\">, CPF</span><b><span style=\"font-size: 9pt; font-family: Verdana\"> %cpfcliente%</span></b><span style=\"font-size: 9pt; font-family: Verdana\">, declaro para os devidos fins que estou recebendo um carnê com boletos para pagamento de serviços mensais, no qual estou ciente que</span><span style=\"font-size: 9pt; font-family: Verdana\">:</span></p><b><span style=\"font-size: 9pt; font-family: Verdana\"><br>1. <strong>SEGUNDA VIA DO BOLETO OU CARNÊ</strong></span></b><strong><br>\n</strong>\n<p style=\"text-align: justify\"><font size=\"3\"><span style=\"font-size: 9pt; font-family: Verdana\">1.1 Caso necessite de uma segunda via do carnê ou boleto, poderá ser cobrado como serviço extra.</span></font></p><p style=\"text-align: justify\"><font size=\"3\"><span style=\"font-size: 9pt; font-family: Verdana\">1.2 </span></font><font size=\"2\"><font size=\"3\"><font size=\"2\">Para gerar uma segunda via de boleto, poderá gerar online sem custos, para isso acesse a central do cliente em <b>%urlcentralcliente%</b>. Necessita apenas do login e senha, caso não tenha, poderá solicitar agora mesmo</font></font></font></p><br><b>2<span style=\"font-size: 9pt; font-family: Verdana\">. </span>ATRASO DE PAGAMENTO</b><br>&nbsp;<br>2.1 Em caso de atraso no pagamento estão sujeito a gerar multa de até <b>%multaatrasocliente%</b> e Juros diário de <b>%jurosatrasocliente%</b> por cada boleto em atraso.<br>&nbsp;<br>2.2 E caso o atraso ultrapasse<b> %diasbloquearcliente%</b> Dias do vencimento o serviço poderá ser bloqueado automaticamente, podendo ser liberado somente após o pagamento total ou parcial dos débitos.<br>&nbsp;<br><br><b>3. FORMA DE PAGAMENTO DOS BOLETOS</b><br>&nbsp;<br>3.1 O pagamento poderá ser feito além de boleto, por depósito (para isto solicite numero da conta).<br>&nbsp;<br>3.2&nbsp; Por cartão de crédito (é necessário verificação e poderá ser cobrada taxa extra).<br>&nbsp;<br>3.3 Por cobrador (é necessário ligar e marca o horário e está sujeita a apenas 01 cobrança por mês).<br><br>3.4 Ou pessoalmente no endereço discriminado na capa do carnê. <br><br><b>4. CANCELAMENTO DO SERVIÇO</b><br>&nbsp;<br>4.1 Em caso de cancelamento, o mesmo deverá ser informado com pelo menos 30 dias de antecedência para que seja cancelada as futuras cobranças sem nenhum custo extra.<br><br>\n<p style=\"text-align: right\" align=\"right\"><b><span style=\"font-size: 9pt; font-family: Verdana\">%provedorcidade%, %data%</span></b></p><div align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\"></span><br>___________________________________________<br></div><div align=\"center\"><b>%nomecliente%</b><br><b>CPF: %cpfcliente% - RG.%rgcliente%</b><br></div>\n</div> \n\n', '<!doctype html>\n<html>\n<head>\n	<title>Recibo</title>\n</head>\n<body>\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"font-family:courier new,courier,monospace;\"><strong><span style=\"font-size:16px;\"><font style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; background-color: rgb(255, 255, 255);\">Ola %nome_cliente%, foi gerado um recibo no valor de&nbsp;R$ %valor_recibo% em %data_pagamento%.&nbsp;</font></span></strong><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\" />\n<span style=\"font-size:12px;\"><span style=\"color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">Use o link abaixo para acessar e imprimir o recibo.</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\" />\n<span style=\"color: rgb(34, 34, 34); background-color: rgb(255, 255, 255);\">Caso n&atilde;o consiga abrir o link, copie e cole o link abaixo na barra de endere&ccedil;os do seu browser:</span></span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\" />\n<a href=\"http://mkfacil.cf/main/pages/gerar_recibo.php?id_recibo=%id_recibo%\">http://mkfacil.cf/main/pages/gerar_recibo.php?id_recibo=%id_recibo%</a></span></div>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"font-family:courier new,courier,monospace;\"><tt><small><big><span style=\"color: rgb(34, 34, 34); font-size: 12.8px; background-color: rgb(255, 255, 255);\">Para sua maior comodidade, poder&aacute; efetuar o pagamento de suas mensalidades&nbsp;em:</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\" />\n<font color=\"#000000\" size=\"2\" style=\"font-family: arial, sans-serif; background-color: rgb(255, 255, 255);\"><b>Cyber Universo Virtual</b><br />\n<i>Rua Jer&ocirc;nimo de Albuquerque, 1859, Nova Lima - Campo Grande - MS</i></font></big></small></tt></span></div>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\"><span style=\"font-family:courier new,courier,monospace;\"><span style=\"color: rgb(34, 34, 34); font-size: 12.8px; background-color: rgb(255, 255, 255);\">Atenciosamente</span><br style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\" />\n<strong style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 12.8px; background-color: rgb(255, 255, 255);\">Depto Financeiro<br />\n<span class=\"HOEnZb\"><font color=\"#888888\"><span class=\"il\">TECNET</span>&nbsp;INFORM&Aacute;TICA<br />\n<a href=\"mailto:email%3Acontato@uvsat.com\" style=\"color: rgb(17, 85, 204);\" target=\"_blank\">email:tecnetcg@<span class=\"il\">gmail</span>.com</a><br />\nCentral:<br />\n(67)99139-7194 / (67)99202-0992</font></span></strong></span></div>\n</body>\n</html>\n', '', 'ativo', 'TECNET');
INSERT INTO `fc_scripts` (`id_scriptsfc`, `nome_scriptsfc`, `dependencia_scriptsfc`, `html_scriptsfc`) VALUES
(1, 'listar', '', 'function listar(page,tipo,obj,arg1,valor1,arg2,valor2,arg3,valor3){\n					getLoading(\'Localizando \'+tipo+\'...\');\n		  	    	$.ajax({url: \'remote.php\',data:\'cmd=list&tipo=\'+tipo+\'&\'+arg1+\'=\'+valor1+\'&\'+arg2+\'=\'+valor2+\'&\'+arg3+\'=\'+valor3,dataType: \"json\"}).then( function ( response ) {\n		  	      		if(!response.auth) \n		  	      			location.reload();\n		  	      		//\n						if($(\"#valor_custos_\"+tipo).length)\n							$(\"#valor_custos_\"+tipo).html(response.valor_total);\n						//\n		  	      		var html=\'<li data-role=\"list-divider\">\'+response.title+\'<span class=\"ui-li-count\">\'+response.qtd+\'</span></li>\';\n		  	      		if(response.qtd==0){\n		  	      			html +=\"<li><font color=\'red\'>Nenhum(a) \"+tipo+\"</font></li>\";\n		  	      		}\n		  	      		if(response.qtd!=0){\n			  	      		$.each(response.suggestion, function ( i, dados ) {\n			  	              	html += \"<li><a href=\\\"#\\\" onclick=\\\"loadScript(\'alteraDB\',false,\'alteraDB(\\\\\\\'lista\\\\\\\',\\\\\\\'\"+tipo+\"\\\\\\\',\\\\\\\'\"+dados.id+\"\\\\\\\')\');\\\">\"+dados.name+\"</a><a href=\\\"#\\\" onclick=\\\"loadScript(\'removeDB\',false,\'removeDB(\\\\\\\'\"+tipo+\"\\\\\\\',\\\\\\\'\"+dados.id+\"\\\\\\\',\\\\\\\'\"+dados.valor+\"\\\\\\\')\');\\\">Remove Dados</a></li>\";\n			  	            });\n		  	      		}\n		  	      		$(\"#\"+obj).html(html);\n		  	      		$(\"#\"+obj).listview(\"refresh\");\n		  	      		$(\"#\"+obj).trigger(\"updatelayout\");\n		  	          	$.mobile.loading(\"hide\")\n		  	      	});\n				}'),
(2, 'removeDB', '', 'function removeDB(tipo,id,valor){\n					if (confirm(\"Remover (\"+valor+\") \"+tipo+\" com id:\"+id+\"?\") == true) {\n						getLoading(\'Localizando \'+tipo+\'...\');\n			  	    	$.ajax({url: \'remote.php\',data:\'cmd=remove&tipo=\'+tipo+\'&id=\'+id+\'&valor=\'+valor,dataType: \"json\"}).then( function ( response ) {\n				            $.mobile.loading(\"hide\");\n							\n				       	});					\n					}\n				}'),
(3, 'alteraDB', 'visibleItens,listar', 'function alteraDB(origem,tipo,id){\n					if(origem==\'detalhes\')\n						$(\'#detalhes_\'+tipo).one(\'popupafterclose\', function(){ $(\'#cadastro_\'+tipo).popup(\'open\'); }).popup(\'close\');\n					else if(origem==\'lista\')\n						$(\'#cadastro_\'+tipo).popup(\'open\');	\n					//\n					$(\"#title_cadastro_\"+tipo).html(\'Alterar\');\n					getLoading(\'Localizando \'+tipo+\' de id:\"+id+\"...\');\n				    $.ajax({url: \'remote.php\',data:\'cmd=load&tipo=\'+tipo+\'&id=\'+id,dataType: \"json\"}).then( function (retorno) {\n						$.mobile.loading(\"hide\");\n						if(retorno.qtd==1){\n							var valor=\'\';\n							var campo=\'tipo_\'+tipo+\'fc\';\n							$.each(retorno.data, function(key, value){\n								$(\"[name=\'\"+key+\"\']\").val(value);\n								if($(\"[name=\'\"+key+\"\']\").attr(\"type\")==\'hidden\')\n									$(\"[name=\'\"+key+\"\']\").change();\n								//\n								if($(\"[name=\'\"+key+\"\']\").attr(\"data-role\")==\'slider\')\n									$(\"[name=\'\"+key+\"\']\").slider(\"refresh\");\n								else if($(\"[name=\'\"+key+\"\']\").is(\'select\'))\n									$(\"[name=\'\"+key+\"\']\").selectmenu(\'refresh\', true).change();\n								//\n								if($(\"[name=\'\"+key+\"\']\").attr(\"type\")==\'checkbox\' && value==\'on\')\n									$(\"[name=\'\"+key+\"\']\").prop(\'checked\', true).checkboxradio(\'refresh\');\n								//\n								if(key==campo)\n									valor=value;\n								//\n							});\n							if(tipo==\'vendas\')\n								sum();\n							else if(tipo==\'produtos\' || tipo==\'itens\'){\n								visibleItens(\'cadastro_\'+tipo,valor);\n								listar(tipo,\'itens_\'+tipo,\'lista_itens_\'+tipo,\'id\',id);\n							}\n						}\n					});\n				}'),
(4, 'getDezena', '', 'function getDezena(num){\n					if (num) {\n						if(num<10)\n							num=\'0\'+num;\n						return num;				\n					}\n				}'),
(5, 'setArgData', 'getDezena', 'function setArgData(tipo,valor,opcao){\n					var dataArray=valor.split(\"/\")\n					var dtHje = new Date(dataArray[1]+\'/\'+dataArray[0]+\'/\'+dataArray[2]); \n					var newData;\n					if(tipo==\'dia\' || tipo==\'hoje\'){\n						if(opcao==\'+\')\n							dtHje.setDate(dtHje.getDate() + 1);	\n						else if(opcao==\'-\')\n							dtHje.setDate(dtHje.getDate() - 1);		\n						//\n						tipo=\'dia\';\n						newData=getDezena(dtHje.getDate())+\'/\'+getDezena((dtHje.getMonth()+1))+\'/\'+dtHje.getFullYear();\n					}else if(tipo==\'mes\'){\n						if(opcao==\'+\')\n							dtHje.setMonth(dtHje.getMonth() + 1);	\n						else if(opcao==\'-\')\n							dtHje.setMonth(dtHje.getMonth() - 1);		\n						//\n						newData=getDezena((dtHje.getMonth()+1))+\'/\'+dtHje.getFullYear();\n					}else if(tipo==\'ano\'){\n						if(opcao==\'+\')\n							dtHje=dtHje.setFullYear(dtHje.getFullYear() + 1);	\n						else if(opcao==\'-\')\n							dtHje=dtHje.setFullYear(dtHje.getFullYear() - 1);		\n						//\n						newData=dtHje.getFullYear();\n					}\n					$(\"#tipo_data\").html(tipo);\n					$(\"#valor_data\").html(newData);\n					$(\"#data_real\").val(getDezena(dtHje.getDate())+\'/\'+getDezena((dtHje.getMonth()+1))+\'/\'+dtHje.getFullYear());\n				}'),
(6, 'salvarDados', 'clear_form_elements', 'function salvaDados(id) {\n\n					//\n					var pai=$(\"#\"+id);\n					var validad=true;\n					$(pai).find(\"input.required\").each(function() {\n						if($(this).val()==\'\'){\n							validad=false; \n						}\n					});\n					if(!validad)\n						return false;\n					//\n					var tempName = [];\n					var tempData = {};\n					$(pai).find(\"input, select\").each(function() {\n						var name=$(this).attr(\"name\");\n						//alert(name+\'-\'+tempName[name]);\n						if(name && !tempName[name]){\n							//alert(name+\'-\'+$(\"[name=\'\"+name+\"\']\").length);\n							tempName[name]=true;\n							if($(pai).find(\"[name=\'\"+name+\"\']\").length>1){\n								var valor=[];\n								$(pai).find(\"[name=\'\"+name+\"\']\").each(function(i) {\n									valor[i]=$(this).val();\n								});\n							}else{\n								var valor=$(this).val();\n							}\n							tempData[name] = valor;\n						}\n					}); \n					getLoading(\'Cadastrando...\');\n					$.post(\'remote.php\',tempData,function(data){\n						$.mobile.loading(\"hide\");\n						clear_form_elements($(pai));\n					});\n				}'),
(7, 'clear_form_elements', '', 'function clear_form_elements(obj) {\n					$(obj).find(\"input, select\").each(function() {\n						if(this.type==\'checkbox\' || this.type==\'radio\')\n							 this.checked = false;\n						else\n							if(!$(this).attr(\"data-fix\") && this.type!=\'hidden\')\n								$(this).val(\'\');\n						//\n						if($(this).attr(\"data-role\")==\'slider\')\n							$(this).slider(\"refresh\");\n						else if($(this).is(\'select\'))\n							$(this).selectmenu(\'refresh\', true);\n						//\n			        });\n			    }'),
(8, 'visibleItens', '', 'function visibleItens(id,valor) {\n					if(valor==\'comprado\'){\n						$(\'#custo_\'+id).css(\"display\", \"block\");	\n						$(\'#itens_\'+id).css(\"display\", \"none\");\n						$(\'#infor_itens_\'+id).css(\"display\", \"none\");			\n					}else if(valor==\'produzido\'){\n						$(\'#custo_\'+id).css(\"display\", \"none\");\n						var tipo=id.split(\"_\")[1];			\n						if($(\'#id_\'+tipo+\'fc\').val()==\'\'){\n							$(\'#infor_itens_\'+id).css(\"display\", \"block\");	\n						}else{\n							$(\'#itens_\'+id).css(\"display\", \"block\");	\n							$(\'#infor_itens_\'+id).css(\"display\", \"none\");\n						}					\n					}	\n			    }'),
(9, 'autoCompleteText', 'getPassword,ocac', 'var interval = 0;\n		  	function AutoCompleteText(obj,idp){		\n		  		var idul=false;\n		  		if(obj.attr(\"data-id-ul\") && obj.attr(\"data-id-ul\")!=\'\' && $(\"#\"+obj.attr(\"data-id-ul\")).is(\"ul\")){\n		  			idul=obj.attr(\"data-id-ul\");\n		  			if(obj.attr(\"data-name-input\"))\n		  				obj.attr(\"name\",obj.attr(\"data-name-input\"));\n		  			//\n		  		}else{\n		  			idul=getPassword(\'ul_\',6);\n		  			$(obj).after(\'<ul id=\"\'+idul+\'\" data-role=\"listview\" data-inset=\"true\"></ul>\');\n		  			$(\"#\"+idul).listview();\n		  			obj.attr(\"data-id-ul\",idul);\n		  			if(obj.attr(\"data-name-input\"))\n		  				obj.attr(\"name\",obj.attr(\"data-name-input\"));\n		  			//\n		  		}\n		  			var value = obj.val();\n		  	        var html = \"\";\n		  	      	$(\"#\"+idul).html(\"\");\n		  	      	var dataUrl = obj.attr(\"data-url\").replace(\"{val}\", value);\n		  	      	var dataData=\'\';\n		  	      	var q = dataUrl.indexOf(\"?\");\n		  			if(q>0){\n		  				dataData=dataUrl.substr(q+1);\n		  				dataUrl=dataUrl.substr(0,q);\n		  			}\n		  	      	var titulo=\'\';\n		  	      	var newitem=\'\';\n		  	      	var match=\'\';\n		  	      	var idclick=\'\';\n		  	    	var loadclick=\'\';\n		  	  		var color=\'red\';\n		  	  		var dataDelay=100;\n		  	  		var dataSpeed=\'\';\n		  	  		var useCache=\'\';\n		  	  		var useTimeout=\'\';\n		  	  		var loading=\'\';\n		  	  		var minlen=\'\';\n		  	  		var argsSend=\'\';\n		  			if(obj.attr(\"data-titulo\")){\n		  				titulo=obj.attr(\"data-titulo\");\n		  			}\n		  			if(obj.attr(\"args-send-value\")){\n		  				var argSarray=obj.attr(\"args-send-value\").split(\"|\");\n		  				argsSend=\'&\'+argSarray[0]+\'=\'+$(\"#\"+argSarray[1]).val();\n		  			}\n		  			if(obj.attr(\"data-newitem\")){\n		  				newitem=obj.attr(\"data-newitem\");\n		  			}\n		  			if(obj.attr(\"data-no-match\")){\n		  				match=obj.attr(\"data-no-match\");\n		  			}\n		  			if(obj.attr(\"data-id-click\")){\n		  				idclick=obj.attr(\"data-id-click\");\n		  			}\n		  			if(obj.attr(\"data-load-click\")){\n		  				loadclick=obj.attr(\"data-load-click\");\n		  			}\n		  			if(obj.attr(\"data-color\")){\n		  				color=obj.attr(\"data-color\");\n		  			}\n		  			if(obj.attr(\"data-loading\")){\n		  				loading=obj.attr(\"data-loading\");\n		  			}\n			  		if(obj.attr(\"data-speed\")) try{\n						dataSpeed=parseInt(obj.attr(\"data-speed\"));\n					}catch(x){\n						dataSpeed=200;\n					}\n		  	      	if (obj.attr(\"data-delay\")) try {\n		  	      		dataDelay = parseInt(obj.attr(\"data-delay\"))\n		  	      	} catch (x) {\n		  	      		dataDelay=1000;\n		  	      	}\n		  	      	if (obj.attr(\"data-cache\")) try {\n		  	      		useCache = parseBool(obj.attr(\"data-cache\"))\n		  	      	} catch (x) {\n		  	      		useCache = !0;\n		  	      	}\n		  	      	if (obj.attr(\"data-timeout\")) try {\n		  	      		useTimeout = parseInt(obj.attr(\"data-timeout\"))\n		  	      	} catch (x) {\n		  	        	useTimeout = 0;\n		  	      	}\n		  	      	if (obj.attr(\"data-minlen\")) try {\n		  	      		minlen = parseInt(obj.attr(\"data-minlen\"))\n		  	      	} catch (x) {\n		  	      		minlen = 2;\n		  	      	} \n		  	      	clearInterval(interval);\n		  	      	interval = window.setTimeout(function(){\n			  	      	var val=obj.val().trim();\n	  	        		if (val.length >= minlen) {\n	  	        			var callData=dataData+argsSend;\n	  	        			var loading = loading || $.mobile.loader.prototype.options.text;\n				  	        getLoading(loading);\n				  	    	$.ajax({\n				  	    		url: dataUrl,\n				  	            data: callData,\n				  	            cache: useCache,\n				  	            dataType: \"json\",\n				  	            crossDomain: !0,\n				  	            timeout: useTimeout\n				  	      	}).then( function ( response ) {\n				  	      		if(!response.auth) \n				  	      			location.reload();\n				  	      		//\n				  	      		if(response.qtd==0){\n				  	      			if(newitem)