(19, 'onLoadItensItens', 'decimalFormat,intFormat', 'function onLoadItensItens(idg){\r\n				var pai=$(\"#\"+idg);\r\n				var dados=$(pai).find(\"[id=\'id_embalagem_valor_item_itens\']\").val().split(\"|\");\r\n				$(pai).find(\"[id=\'id_item_itens\']\").val(dados[0]);\r\n				$(pai).find(\"[id=\'embalagem_item_itens\']\").html(dados[1]);\r\n				$(pai).find(\"[id=\'valor_inicial_item_itens\']\").val(dados[2]);\r\n				$(pai).find(\"[id=\'valor_item_itens\']\").html(decimalFormat(intFormat($(pai).find(\"[id=\'qtd_item_itens\']\").val())*intFormat($(pai).find(\"[id=\'valor_inicial_item_itens\']\").val())));\r\n			}'),
(10, 'ocac', '', 'function ocac(id,value,idclick,idul){\n				if(idclick && idclick!=\'\')\n					if($(\"#\"+idclick).is(\"input\"))\n						$(\"#\"+idclick).val(id);\n					else\n						$(\"#\"+idclick).html(id);\n				//\n				$(\'input[data-id-ul=\"\'+idul+\'\"]\').val(value);\n				$(\"#\"+idul+\" li\").remove();\n				$(\"#\"+idul).listview(\"refresh\");\n				$(\"#\"+idul).remove();\n			}'),
(11, 'getPassword', '', 'function getPassword(iniciais,qtd) {\n				if(!iniciais)\n					var iniciais=\"\"\n							var rc = iniciais;\n				var numberChars = \"0123456789\";\n				var count = qtd-rc.length;\n				for (var idx = 1; idx <= count; ++idx) {\n					rc = rc + numberChars.charAt(Math.floor(Math.random() * (numberChars.length - 0)) + 0);\n				}\n				return rc;\n			}'),
(12, 'onLoadProdutos', 'sum', 'function onLoadProdutos(){\n				var dados=$(\"#idvalor\").val().split(\"|\");\n				$(\"#id_produto_vendasfc\").val(dados[0]);\n				$(\"#valor_vendasfc\").val(dados[1]);\n				$(\"#valor_custo_vendasfc\").val(dados[2]);\n				sum();\n			}'),
(13, 'onLoadItens', 'decimalFormat,intFormat', 'function onLoadItens(idg){\n				var pai=$(\"#\"+idg);\n				var dados=$(pai).find(\"[id=\'id_embalagem_valor_item\']\").val().split(\"|\");\n				$(pai).find(\"[id=\'id_item\']\").val(dados[0]);\n				$(pai).find(\"[id=\'embalagem_item\']\").html(dados[1]);\n				$(pai).find(\"[id=\'valor_inicial_item\']\").val(dados[2]);\n				$(pai).find(\"[id=\'valor_item\']\").html(decimalFormat(intFormat($(pai).find(\"[id=\'qtd_item\']\").val())*intFormat($(pai).find(\"[id=\'valor_inicial_item\']\").val())));\n			}'),
(14, 'sum', 'intFormat,decimalFormat', 'function sum(){ \n				var total=intFormat($(\"#valor_vendasfc\").val())*intFormat($(\"#qtd_vendasfc\").val())-intFormat($(\"#valor_desconto_vendasfc\").val());\n				$(\"#valor_total\").html(decimalFormat(total));\n				$(\"#valor_total_vendasfc\").val(decimalFormat(total));\n				$(\"#valor_total_custos_vendasfc\").val(decimalFormat(intFormat($(\"#valor_custo_vendasfc\").val())*intFormat($(\"#qtd_vendasfc\").val())));\n				$(\"#valor_pago_vendasfc\").val(decimalFormat(total));\n			}'),
(15, 'sumItem', 'intFormat,decimalFormat', 'function sumItem(){\n				var total=intFormat($(\'#qtd_item\').val())*intFormat($(\'#valor_inicial_item\').val());\n				$(\"#valor_item\").html(decimalFormat(total));\n			}'),
(16, 'intFormat', '', 'function intFormat(texto){\n				texto=texto.replace(\",\",\".\");\n				return texto*1;\n			}'),
(17, 'decimalFormat', '', 'function decimalFormat(number){\n				formatedNumber = number.toFixed(2);\n				formatedNumber=formatedNumber.replace(\".\",\",\");\n				return(formatedNumber);\n			}'),
(18, 'datepicker', '', '$(\".datebox\").datepicker({\n				dateFormat: \'dd/mm/yy\',\n				dayNames: [\'Domingo\',\'Segunda\',\'Terça\',\'Quarta\',\'Quinta\',\'Sexta\',\'Sábado\',\'Domingo\'],\n				dayNamesMin: [\'D\',\'S\',\'T\',\'Q\',\'Q\',\'S\',\'S\',\'D\'],\n				dayNamesShort: [\'Dom\',\'Seg\',\'Ter\',\'Qua\',\'Qui\',\'Sex\',\'Sáb\',\'Dom\'],\n				monthNames: [\'Janeiro\',\'Fevereiro\',\'Março\',\'Abril\',\'Maio\',\'Junho\',\'Julho\',\'Agosto\',\'Setembro\',\'Outubro\',\'Novembro\',\'Dezembro\'],\n				monthNamesShort: [\'Jan\',\'Fev\',\'Mar\',\'Abr\',\'Mai\',\'Jun\',\'Jul\',\'Ago\',\'Set\',\'Out\',\'Nov\',\'Dez\']\n			});'),
(20, 'sumItemItem', 'intFormat,decimalFormat', 'function sumItemItem(){\r\n				var total=intFormat($(\'#qtd_item_itens\').val())*intFormat($(\'#valor_inicial_item_itens\').val());\r\n				$(\"#valor_item_itens\").html(decimalFormat(total));\r\n			}');
