(22, 'getEnd', '', '	//FUNCAO BUSCA ENDEREÇO\n	function getEnd(cep,valEnd) {\n		if($.trim(cep) != \"\"){\n			getLoading(\'Buscando Endereço, aguarde...\');\n			$.getScript(\"remote.php?cmd=busca&tipo=end&formato=javascript&cep=\"+cep, function(){\n		  		if(resultadoCEP[\"resultado\"]){\n		  			$(\"#\"+valEnd.logradouro).val(unescape(resultadoCEP[\"tipo_logradouro\"]).toUpperCase()+\' \'+unescape(resultadoCEP[\"logradouro\"]).toUpperCase());\n		  			$(\"#\"+valEnd.bairro).val(unescape(resultadoCEP[\"bairro\"]).toUpperCase());\n		  			$(\"#\"+valEnd.cidade).val(unescape(resultadoCEP[\"cidade\"]).toUpperCase()); \n		  			$(\"#\"+valEnd.uf).val(unescape(resultadoCEP[\"uf\"]).toUpperCase());\n		  			$.mobile.loading(\"hide\");\n		  			//showPopup({title: \"Sucesso!\", message: \"Cep \"+cep+\" correto, End:\"+resultadoCEP[\'tipo_logradouro\']+\" \"+resultadoCEP[\'logradouro\']+\"!\", buttonText: \"I know!\", width: \"500px\"});\n				}else{\n					//showPopup({title: \"Error\", message: \'Cep não encontrado!\', buttonText: \"I know!\", width: \"500px\"});\n					//$(\"#popupDialog\").popup(\"open\");\n					$.mobile.loading(\"hide\");\n					alert(\'Nenhum endereço encontrado!\');\n				}\n			});			\n		}else{\n			$(\"#\"+valEnd.cep).focus();\n			alert(\'Preencha corretamento o cep!\');\n		}	\n	}'),
(23, 'getCep', '', 'function getCep(valEnd) {\n	var uf=$(\"#\"+valEnd.uf).val();\n	var cid=$(\"#\"+valEnd.cidade).val();\n	var log=$(\"#\"+valEnd.logradouro).val();\n	var end=\'\';\n	if(uf!=\'\' && cid!=\'\' && log!=\'\'){\n		end=uf+\'/\'+cid+\'/\'+log;\n	}\n	if(end != \'\'){\n		getLoading(\'Buscando Cep, aguarde...\');\n		$.ajax({\n  	    		url: \"https://viacep.com.br/ws/\"+end+\"/json/\",\n  	    		dataType: \"json\",\n  	    		crossDomain: !0\n  	      	}).then( function (results) {\n			$.mobile.loading(\"hide\");\n			//alert(results);\n			if(results.length!=0){\n				var output = [];\n				$.each(results, function( key1, val1 ) {\n					//alert(val1.formatted_address)\n					if(val1.cep!=\'\')\n						output.push(\'<li><a onclick=\"$(\\\'#\'+valEnd.cep+\'\\\').val(\\\'\'+val1.cep+\'\\\');$(\\\'#\'+valEnd.logradouro+\'\\\').val(\\\'\'+val1.logradouro+\'\\\');$(\\\'#\'+valEnd.bairro+\'\\\').val(\\\'\'+val1.bairro+\'\\\');$.mobile.sdCurrentDialog.close();\">\'+val1.cep+\' - \'+val1.logradouro+\', \'+val1.bairro+\'</a></li>\');\n					//\n				});\n//alert(output);\n				if(output.length>0){\n					$(\"#titulo_PageListView\").html(\"Cep(s) (\"+output.length+\")\");\n					$(\"#list_PageListView\").empty().append(output.join(\'\')).listview(\'refresh\');\n					$(\"#list_PageListView\").listview(\'refresh\');\n					$(\"#PageListView\").simpledialog2();\n				}else{\n					alert(\"Nenhum cep encontrado!\");\n				}\n			}else{\n				alert(\'Nenhum cep encontrado!\');\n			}\n		});\n	}else{\n		$(\"#\"+valEnd.logradouro).focus();\n		alert(\'Preencha corretamento o endereço!\');\n	}	\n}'),
(29, 'replaceAll', '', 'function replaceAll(string, token, newtoken) {\r\n		while (string.indexOf(token) != -1) {\r\n	 		string = string.replace(token, newtoken);\r\n		}\r\n		return string;\r\n	}'),
(25, 'onloadPontos', '', 'function onloadPontos() {\n		$(\"#end_add\").find(\'option\').prop(\'disabled\', false);\n		if($(\"#end1_clientesfc\").val()==\'\')\n			$(\"#end_add\").find(\'option[value=1]\').prop(\'disabled\', true);\n		else\n			$(\"#end_add\").find(\'option[value=1]\').html($(\"#end1_clientesfc\").val()+\', \'+$(\"#num1_clientesfc\").val()+\', \'+$(\"#bar1_clientesfc\").val()+\', \'+$(\"#cid1_clientesfc\").val()+\'-\'+$(\"#uf1_clientesfc\").val());\n		//\n		if($(\"#end2_clientesfc\").val()==\'\')\n			$(\"#end_add\").find(\'option[value=2]\').prop(\'disabled\', true);\n		else\n			$(\"#end_add\").find(\'option[value=2]\').html($(\"#end2_clientesfc\").val()+\', \'+$(\"#num2_clientesfc\").val()+\', \'+$(\"#bar2_clientesfc\").val()+\', \'+$(\"#cid2_clientesfc\").val()+\'-\'+$(\"#uf2_clientesfc\").val());\n		//\n		$(\"#end_add\").selectmenu(\'refresh\');\n		//downloads selects\n		$(\"#cadastro_clientes_pontos\").find(\'select[data-role=\"auto\"][data-url]\').each(function() {\n			var inp=$(this);\n			var dataUrl=inp.attr(\"data-url\");\n			$.ajax({url: dataUrl,\n	            success: function(output) {\n	               inp.html(output);\n	           },\n	         error: function (xhr, ajaxOptions, thrownError) {\n	           alert(xhr.status + \" \"+ thrownError);\n	         }});\n		});\n	}'),
(24, 'showPopup', '', 'function showPopup(context) {\r\n    var popup = \'<div data-role=\"popup\" id=\"popupDialog\" data-overlay-theme=\"a\" data-theme=\"c\" data-dismissible=\"false\" style=\"max-width:400px;\" class=\"ui-corner-all\"><div data-role=\"header\" data-theme=\"a\" class=\"ui-corner-top\"><h1>Delete Page?</h1></div><div data-role=\"content\" data-theme=\"d\" class=\"ui-corner-bottom ui-content\"><h3 class=\"ui-title\">Are you sure you want to delete this page?</h3><input value=\"BBB\" type=\"button\" data-theme=\"b\" /></div></div>\';\r\n    $.mobile.activePage.append(popup).trigger(\"pagecreate\");\r\n\r\n    $(selectorPopupDialog + \' input[type=button]\').click(function() {\r\n        $(selectorPopupDialog).popup(\'close\');\r\n    });\r\n    if (context.width)\r\n        $(selectorPopupDialog).width(context.width);\r\n    if (context.title)\r\n        $(selectorPopupDialog + \' h1\').html(context.title);\r\n    if (context.message)\r\n        $(selectorPopupDialog + \' h3\').html(context.message);\r\n    if (context.buttonText) {\r\n        $(selectorPopupDialog + \' input\').val(context.buttonText).button(\'refresh\');\r\n    }\r\n    $(selectorPopupDialog).popup(\"open\");\r\n    $(document).on(\"popupafterclose\", \".ui-popup\", function() {\r\n        $(this).remove();\r\n    });\r\n}');
