(26, 'addIntemPontos', 'decimalFormat', 'var id_ponto=0;\r\n	function addIntemPontos(id_del){\r\n		if(id_del && id_del!=\'\'){\r\n			id_del.remove();\r\n		}else{\r\n			var id_pontos=\'\';\r\n			if($(\"#id_pontosfc\").val()!=\'\'){\r\n				var id=$(\"#id_pontos_add\").val();\r\n				id_pontos=id;\r\n			}else\r\n				var id=id_ponto+1;\r\n			//\r\n			var end=$(\"#end_add\").val();\r\n			var outro_end=$(\"#outro_end_add\").val();\r\n			var lat=$(\"#lat_add\").val();\r\n			var lon=$(\"#lon_add\").val();\r\n			var torreArr=$(\"#torre_add\").val().split(\"|\");\r\n			var mk=$(\"#mk_add\").val();\r\n			var equip=$(\"#equip_add\").val();\r\n			var tipo_equip=$(\"#tipo_equip_add\").val();\r\n			var tipo_auth=$(\"#tipo_auth_add\").val();\r\n			var name_secret=$(\"#name_secret_add\").val();\r\n			var id_secret=$(\"#id_secret_add\").val()\r\n			var planoArr=$(\"#plano_add\").val().split(\"|\");\r\n			var id_profile=0;\r\n			if(tipo_auth==\'pppoe\'){\r\n				id_profile=planoArr[2];\r\n			}else if(tipo_auth==\'hotspot\'){\r\n				id_profile=planoArr[3];\r\n			}else if(tipo_auth==\'binding\'){\r\n				id_profile=planoArr[4];\r\n			}\r\n			//\r\n			var gratis=$(\"#gratis_add\").val();\r\n			var desconto=$(\"#desconto_add\").val();\r\n			var acrescimo=$(\"#acrescimo_add\").val();\r\n			$(\'#itens_pontos li\').each(function(){\r\n				if($(this).attr(\"id\")){\r\n					var idArr=$(this).attr(\"id\").split(\"_\");\r\n					if(idArr[1]==id){\r\n						$(this).remove();\r\n					}\r\n				}\r\n			});\r\n			var html=$(\"#itens_pontos\").html();\r\n			html +=\'<li id=\"item_\'+id+\'\">\';\r\n	      	html +=\'<a href=\"#\" onclick=\"$(\\\'#cadastro_clientes\\\').one(\\\'popupafterclose\\\', function(){$(\\\'#cadastro_clientes_pontos\\\').popup(\\\'open\\\')}).popup(\\\'close\\\');\">\';\r\n	      	html +=\'<input name=\"endereco_pontosfc[]\" value=\"\'+end+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"outro_endereco_pontosfc[]\" value=\"\'+outro_end+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"latitude_pontosfc[]\" value=\"\'+lat+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"longitude_pontosfc[]\" value=\"\'+lon+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"id_torre_pontosfc[]\" value=\"\'+torreArr[0]+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"lat_torre_pontosfc[]\" value=\"\'+torreArr[1]+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"lng_torre_pontosfc[]\" value=\"\'+torreArr[2]+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"id_mk_pontosfc[]\" value=\"\'+mk+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"equipamentos_pontosfc[]\" value=\"\'+equip+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"tipo_equipamento_pontosfc[]\" value=\"\'+tipo_equip+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"tipo_auth_pontosfc[]\" value=\"\'+tipo_auth+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"name_secret[]\" value=\"\'+name_secret+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"id_secret[]\" value=\"\'+id_secret+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"id_mensalfc[]\" value=\"\'+planoArr[0]+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"id_profile[]\" value=\"\'+id_profile+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"valor_sevmensalfc[]\" value=\"\'+planoArr[1]+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"gratis_sevmensalfc[]\" value=\"\'+gratis+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"valor_desconto_mensalfc[]\" value=\"\'+desconto+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"valor_acrescimo_mensalfc[]\" value=\"\'+acrescimo+\'\" type=\"hidden\">\';\r\n	      	html +=\'<input name=\"id_pontosfc[]\" value=\"\'+id_pontos+\'\" type=\"hidden\">\';\r\n	      	html +=\'<fieldset class=\"ui-grid-a\">\';\r\n	      	html +=\'<div class=\"ui-block-a\" style=\"width:20%\">PONTO \'+id+\'</div>\';\r\n	      	html +=\'<div class=\"ui-block-b\" style=\"width:80%;font-size: 10px;\">\'+equip+\'(\'+tipo_equip+\')<BR>\'+name_secret+\'(\'+tipo_auth+\')<BR>\'+planoArr[5]+\' R$ \'+planoArr[1]+\'</div>\';\r\n	      	html +=\'</fieldset>\';\r\n	      	html +=\'</a>\';\r\n	      	html +=\'<a href=\"#\" onclick=\"addIntemPontos($(this).parent());\">Remove</a>\';\r\n	      	html +=\'</li>\';\r\n	      	$(\"#itens_pontos\").html(html);\r\n		}\r\n    	$(\"#itens_pontos\").listview(\"refresh\");\r\n    	$(\"#itens_pontos\").trigger(\"updatelayout\");\r\n    	$(\"#qtd_itens_pontos\").html($(\'#itens_pontos li\').size()-1); \r\n\r\n    	alert(\'ok\');\r\n    	var valor_mensalidade=\'\';\r\n	    $(\'#itens_pontos li\').each(function(){\r\n			if($(this).attr(\"id\")){\r\n				if($(this).find(\"input[name=\'gratis_sevmensalfc[]\']\").val()!=\'on\'){\r\n					valor_mensalidade+=$(this).find(\"input[name=\'valor_sevmensalfc[]\']\").val()*1+$(this).find(\"input[name=\'valor_acrescimo_mensalfc[]\']\").val()*1-$(this).find(\"input[name=\'valor_desconto_mensalfc[]\']\").val()*1;\r\n				}\r\n			}\r\n		});\r\n	    $(\"#valor_mensalidade\").val(decimalFormat(valor_mensalidade));\r\n	    //sumVendas();\r\n	}'),
(27, 'mapaG', 'removeAcento,replaceAll', 'var torre={};\nvar ids_cord={};\nfunction getAddress(obj){		\n	var id_ul=obj.attr(\"id\");\n	if(!$(obj).is(\"ul\")){\n		id_ul=id_ul+\'_ul\';\n		$(obj).after(\'<ul id=\"\'+id_ul+\'\" data-role=\"listview\" data-inset=\"true\"></ul>\');\n		$(\"#\"+id_ul).listview();\n	}\n  	$(\"#\"+id_ul).html(\"\");\n  	var value=$(obj).val().trim();\n  	if(value && value.length > 2 )\n    	getGeocode(value,id_ul);\n    //\n}\nfunction getGeocode(address,id) {\n	if(id)\n		$(\"#\"+id).html(\"<li><font color=\'green\'><h3>Carregando...</h3></font></li>\").listview(\'refresh\').trigger(\"updatelayout\");\n	//\n	var html=\"\";\n	$.ajax({\n  		url: \"https://maps.google.com/maps/api/geocode/json?address=\"+replaceAll(address,\" \",\"+\")+\"&sensor=true&key=AIzaSyA6IqOjPlJ-uvoe_3Wome-S5qi0hEDRQ20\",\n  		dataType: \"json\",\n  		crossDomain: !0\n	}).then( function (r) {\n		//alert(print_r(r.results))\n		if(r.results.length!=0 && r.results[0].formatted_address && r.results[0].formatted_address!=\'\'){\n			//var output = [];\n			if(!id && (r.results[0].geometry.location.lat!=\'\' && r.results[0].geometry.location.lng!=\'\')){\n				$(\'#lat\').val(r.results[0].geometry.location.lat);\n				$(\'#lng\').val(r.results[0].geometry.location.lng);\n			}else{\n				$.each( r.results, function( key, val ) {\n					//alert(val.geometry.location.lat+\' - \'+val.geometry.location.lng);\n					var lat=val.geometry.location.lat;\n					var lng=val.geometry.location.lng;\n					if(lat!=\'\' && lng!=\'\'){\n						html+=\'<li><a href=\"#\" onclick=\\\"getAddressInput(\\\'\'+removeAcento(val.formatted_address)+\'\\\',\\\'\'+id+\'\\\');getMap(false,\\\'\'+lat+\'|\'+lng+\'\\\');\\\">\'+(key+1)+\' - \'+removeAcento(val.formatted_address)+\'</a></li>\';\n					}\n				});\n			}\n		}else{\n			html=\'<li>Nada Encontrado</li>\';\n		}\n		if(!id)\n			loadScriptMaps();\n		else\n			$(\"#\"+id).html(html).listview(\"refresh\").trigger(\"updatelayout\");\n		//\n	});\n}\nfunction getMap(ids,latlng,address,tor) {\n	if(latlng && latlng!=\'\'){\n		var latlngArray=latlng.split(\"|\");\n		var latlng={};\n		latlng.lat=latlngArray[0];\n		latlng.lon=latlngArray[1];\n	}\n	if(ids)\n		ids_cord=ids;\n	//\n	if(tor)\n		torre=tor;\n	//\n	if(latlng && (latlng.lat!=\'\' && latlng.lon!=\'\')){\n		$(\'#lat\').val(latlng.lat);\n		$(\'#lng\').val(latlng.lon);\n		loadScriptMaps();\n	}else if(address){\n		$(\"#address-mapa\").val(address);\n		getGeocode(address);\n	}else{\n		loadScriptMaps();\n	}\n}\n//\nfunction loadScriptMaps() {\n	//getLoading(\'Carregando MAPA, aguarde...\');\n	if (!$(\"#inscript_googleMaps\").length ){\n		var script = document.createElement(\'script\');\n		script.id = \'inscript_googleMaps\';\n		script.type = \'text/javascript\';\n		script.src = \'https://maps.googleapis.com/maps/api/js?v=3.exp\' +\n		\'&libraries=geometry&sensor=true&signed_in=true&key=AIzaSyA6IqOjPlJ-uvoe_3Wome-S5qi0hEDRQ20&callback=initialize\';\n		document.body.appendChild(script);\n	}else{\n		initialize();\n	}\n}\nfunction initialize() {\n	$(\'#contentMaps\').height(getRealContentHeight());\n	// This is the minimum zoom level that we\'ll allow\n	var lat=$(\'#lat\').val();\n	var lng=$(\'#lng\').val();\n	if(!lat || lat==\'\' && !lng || lng==\'\'){\n		lat=\'-20.3853783\';\n	   	lng=\'-54.5601593\';\n	}\n	var minZoomLevel = 16;\n	//\n	if((torre.lat && torre.lat!=\'\') && (torre.lon && torre.lon!=\'\'))\n		var point1 = new google.maps.LatLng(torre.lat,torre.lon);\n	else\n		var point1 = false;\n	//\n	var point2 = new google.maps.LatLng(lat,lng);\n	//\n	var map = new google.maps.Map(document.getElementById(\'map_canvas\'), {\n		zoom: minZoomLevel,\n	   	center: point2,\n	   	mapTypeId: google.maps.MapTypeId.SATELLITE\n	});\n	if(point1){\n		var route = [point1,point2];\n		var polyline = new google.maps.Polyline({\n			path: route,\n		    strokeColor: \"#ff0000\",\n		    strokeOpacity: 0.6,\n		    geodesic: true,\n		    strokeWeight: 5\n		});	\n		polyline.setMap(map);\n		update(polyline);\n		var marker1 = new google.maps.Marker({\n			position: point1,\n			map: map,\n		  	draggable:false,\n		  	title:\"TORRE \"+torre.nome,\n		  	icon: pinSymbol(\"blue\"),\n		});\n	}\n	//var lengthInMeters = google.maps.geometry.spherical.computeLength(polyline.getPath());\n	\n	///$(\'#distancia\').html(\'Distancia da Torre:\'+lengthInMeters);\n	// Place a draggable marker on the map\n	var marker2 = new google.maps.Marker({\n		position: point2,\n		map: map,\n	  	draggable:true,\n	  	title:\"Local\"\n	});\n	google.maps.event.addListener(marker2, \'dragend\', function (event) {\n	  	$(\'#lat\').val(this.getPosition().lat());\n	  	$(\'#lng\').val(this.getPosition().lng());\n	  	point2 = new google.maps.LatLng($(\'#lat\').val(),$(\'#lng\').val());\n	  	if(point1){\n	  		route = [point1,point2];\n	  		polyline.setPath(route);\n	  		update(polyline);\n	  	}\n	});\n	google.maps.event.addListener(map, \'tilesloaded\', function() {\n		$.mobile.loading(\"hide\");\n	});\n}\nfunction update(polyline) { \n	  var heading = arredondar(google.maps.geometry.spherical.computeLength(polyline.getPath()),2);\n	  $(\'#distancia\').html(\'Distancia da Torre <b>\'+torre.nome+\'</b>:\'+heading+\' mts\');\n}\n\nfunction getRealContentHeight() {\n	var header = $.mobile.activePage.find(\"div[data-role=\'header\']:visible\");\n	var footer = $.mobile.activePage.find(\"div[data-role=\'footer\']:visible\");\n	var content = $.mobile.activePage.find(\"div[data-role=\'content\']:visible:visible\");\n	var viewport_height = $(window).height();\n	var content_height = viewport_height - header.outerHeight() - footer.outerHeight();\n	if((content.outerHeight() - header.outerHeight() - footer.outerHeight()) <= viewport_height) {\n		content_height -= (content.outerHeight() - content.height());\n	} \n	return content_height;\n}\nfunction getAddressInput(address,id) {\n	var idarray=id.split(\"_\");\n	var idam=idarray[0];\n	$(\"#\"+idam).val(address);\n	$(\"#\"+id+\" li\").remove();\n	$(\"#\"+id).listview(\"refresh\");\n}\nfunction getCords() {\n	var lat=$(\"#lat\").val();\n	var lng=$(\"#lng\").val();\n	if(ids_cord && ids_cord.lat!=\'\' && ids_cord.lon!=\'\' && lat!=\'\' && lng!=\'\'){\n		$(\"#\"+ids_cord.lat).val(lat);\n		$(\"#\"+ids_cord.lon).val(lng);\n	}\n	$(\"#lat\").val(\'\');\n	$(\"#lng\").val(\'\');\n	$(\"#address-mapa\").val(\'\');\n}\nfunction openMapa(tipo){\n	var address=\'\'; \n	var torre={};\n	var ids={};\n	var latlng=false;\n	if(tipo==\'ponto\'){\n		var lat=\'\';var lon=\'\';\n		if($(\'#end_add\').val()==\'0\')\n			address=$(\'#outro_end_add\').val();\n		else if($(\'#end_add\').val()==\'1\'){\n			address=$(\"#end_add\").find(\'option[value=1]\').html();\n			lat=$(\"#lat1_clientesfc\").val();lon=$(\"#long1_clientesfc\").val();\n		}else if($(\'#end_add\').val()==\'2\'){\n			address=$(\"#end_add\").find(\'option[value=2]\').html();\n			lat=$(\"#lat2_clientesfc\").val();lon=$(\"#long2_clientesfc\").val();\n		}//\n		if(lat==\'\' && $(\"#lat_add\").val()!=\'\')\n			lat=$(\"#lat_add\").val();\n		if(lon==\'\' && $(\"#lon_add\").val()!=\'\')\n			lon=$(\"#lon_add\").val();\n		//\n		if(lat!=\'\' && lon!=\'\')\n			latlng=lat+\'|\'+lon;\n		//\n		ids.lat=\'lat_add\';ids.lon=\'lon_add\';\n		var torreArr=$(\"#torre_add\").val().split(\"|\");\n		torre.nome=torreArr[3];torre.lat=torreArr[1];torre.lon=torreArr[2];\n	}else if(tipo==\'1\'){\n		if($(\"#end1_clientesfc\").val()!=\'\')\n			address=$(\"#end1_clientesfc\").val()+\', \'+$(\"#num1_clientesfc\").val()+\', \'+$(\"#bar1_clientesfc\").val()+\', \'+$(\"#cid1_clientesfc\").val()+\'-\'+$(\"#uf1_clientesfc\").val();\n		//\n		if($(\"#lat1_clientesfc\").val()!=\'\' && $(\"#long1_clientesfc\").val()!=\'\')\n			latlng=$(\"#lat1_clientesfc\").val()+\'|\'+$(\"#long1_clientesfc\").val();\n		//\n		ids.lat=\'lat1_clientesfc\';ids.lon=\'long1_clientesfc\';\n		torre=false;\n	}else if(tipo==\'2\'){\n		if($(\"#end2_clientesfc\").val()!=\'\')\n			address=$(\"#end2_clientesfc\").val()+\', \'+$(\"#num2_clientesfc\").val()+\', \'+$(\"#bar2_clientesfc\").val()+\', \'+$(\"#cid2_clientesfc\").val()+\'-\'+$(\"#uf2_clientesfc\").val();\n		//\n		if($(\"#lat2_clientesfc\").val()!=\'\' && $(\"#long2_clientesfc\").val()!=\'\')\n			latlng=$(\"#lat2_clientesfc\").val()+\'|\'+$(\"#long2_clientesfc\").val();\n		//\n		ids.lat=\'lat2_clientesfc\';ids.lon=\'long2_clientesfc\';\n		torre=false;\n	}else{\n		ids=false;\n		address=false;\n		torre=false;\n	}\n	//alert(ids.lat+\'-\'+ids.lng);\n	if((latlng && latlng!=\'\') || address==\'\')\n		address=false;\n	//\n	$(\'<div>\').simpledialog2({\n		mode: \'blank\',\n		themeDialog: \'a\',\n		headerText: \'Mapa\',\n		headerClose: true,\n		fullScreen: true,\n		fullScreenForce: true,\n		callbackClose:getCords,\n		zindex:\'10000\',\n		blankContent : \n			\'<div style=\"padding: 5px;height:100%;overflow:scroll;\" id=\"contentMaps\">\'+\n				\'<div class=\"ui-grid-b\">\'+\n					\'<center>\'+ \n			    		\'<div class=\"ui-block-a\"><input id=\"lat-torre\" type=\"hidden\"><input placeholder=\"Latitude\" id=\"lat\" type=\"text\" style=\"width:100px\"></div>\'+\n						\'<div class=\"ui-block-b\"><input id=\"lng-torre\" type=\"hidden\"><input placeholder=\"Longitude\" id=\"lng\" type=\"text\" style=\"width:100px\"></div>\'+\n						\'<div class=\"ui-block-c\"><a href=\"#\" onclick=\"getMap();\" class=\"ui-shadow ui-btn ui-corner-all ui-btn-icon-left ui-icon-search ui-btn-min ui-min\">RELOAD</a></div>\'+\n		    		\'</center>\'+\n		    	\'</div><!-- /grid-b -->\'+\n		    	\'<div class=\"ui-grid-solo\">\'+\n		    		\'<div class=\"ui-block-a\">\'+\n		    			\'<input id=\"address-mapa\" onkeyup=\"getAddress($(this));\" type=\"text\" placeholder=\"Address...\">\'+\n		    		\'</div>\'+\n		    	\'</div>\'+\n		    	\'<div id=\"map_canvas\" style=\"height:400px;\"></div>\'+\n		    	\'<center>\'+\n		    		\'<font size=2 id=\"distancia\"></font><br>\'+\n		    		\'<a rel=\"close\" data-role=\"button\" href=\"#\">Fechar</a>\'+\n		    	\'</center>\'+\n		    \'</div>\'\n	  })\n	  getMap(ids,latlng,address,torre);\n}\nfunction arredondar(valor,casas){\n	var novo = Math.round(valor*Math.pow(10,casas))/Math.pow(10,casas);\n	return(novo);\n}\nfunction pinSymbol(color) {\n    return {\n        path: \'M 0,0 C -2,-20 -10,-22 -10,-30 A 10,10 0 1,1 10,-30 C 10,-22 2,-20 0,0 z M -2,-30 a 2,2 0 1,1 4,0 2,2 0 1,1 -4,0\',\n        fillColor: color,\n        fillOpacity: 1,\n        strokeColor: \'#000\',\n        strokeWeight: 2,\n        scale: 1,\n   };\n}'),
(28, 'removeAcento', '', 'function removeAcento(strToReplace) {\r\n		str_acento= \"áàãâäéèêëíìîïóòõôöúùûüçÁÀÃÂÄÉÈÊËÍÌÎÏÓÒÕÖÔÚÙÛÜÇ\";\r\n		str_sem_acento = \"aaaaaeeeeiiiiooooouuuucAAAAAEEEEIIIIOOOOOUUUUC\";\r\n		var nova=\"\";\r\n		for (var i = 0; i < strToReplace.length; i++) {\r\n			if (str_acento.indexOf(strToReplace.charAt(i)) != -1) {\r\n				nova+=str_sem_acento.substr(str_acento.search(strToReplace.substr(i,1)),1);\r\n			} else {\r\n				nova+=strToReplace.substr(i,1);\r\n			}\r\n		 }\r\n		 return nova;\r\n}');
