DROP PROCEDURE IF EXISTS `agenda_bloqueio`$$
CREATE DEFINER=`provedor`@`localhost` PROCEDURE `agenda_bloqueio` ()  NO SQL
BEGIN
	declare done INT DEFAULT 0;
	declare qtd_bl INT DEFAULT 0;
    declare qtd_db INT DEFAULT 0;
  	declare ID INT;
  	declare PROVEDOR INT;
  	declare ACAO VARCHAR(50);
	DECLARE curs CURSOR FOR (
		SELECT id_bloqueiosfc,IF(data_fim_bloqueiosfc=curdate(),'desbloquear','bloquear') AS acao,id_provedor FROM fc_bloqueios WHERE (exe_bloqueiosfc!='on' AND data_bloqueiosfc != '0000-00-00' AND data_bloqueiosfc <= curdate()) OR (exe_fim_bloqueiosfc!='on' AND data_fim_bloqueiosfc = curdate())
	);
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
 	OPEN curs;
	REPEAT FETCH curs INTO ID, ACAO, PROVEDOR;
		IF NOT done THEN 
			CASE ACAO
				WHEN 'bloquear' THEN 
				    UPDATE fc_bloqueios SET exe_bloqueiosfc='on' WHERE id_bloqueiosfc=ID;
					SET qtd_bl=qtd_bl+1;
				ELSE
                   BEGIN
						UPDATE fc_bloqueios SET exe_fim_bloqueiosfc='on' WHERE id_bloqueiosfc=ID;
						SET qtd_db=qtd_db+1;
					END;
            END CASE;
		END IF;
	UNTIL done END REPEAT;
	CLOSE curs;
END$$

DROP PROCEDURE IF EXISTS `altera_inforpg`$$
CREATE DEFINER=`provedor`@`localhost` PROCEDURE `altera_inforpg` (IN `id_cliente` INT)  NO SQL
BEGIN
	declare valorpago float;
	set valorpago=(SELECT IFNULL(SUM(`valor_caixafc`),0)+IFNULL(SUM(`valor_desconto_caixafc`),0) FROM `fc_caixa` WHERE `tipo_caixafc`='in' AND `id_cliente_caixafc`=id_cliente AND `data_pagamento_caixafc` > IFNULL((SELECT DATE_FORMAT(datatime_inforpgfc,"%Y-%m-%d") FROM `fc_inforpg` WHERE (`sit_inforpgfc`='aberto' OR `sit_inforpgfc`='agendado') AND `id_cliente_inforpgfc`=id_cliente ORDER BY `id_inforpgfc` DESC LIMIT 1),CURDATE()));
	IF(valorpago>0) THEN
		UPDATE `fc_inforpg` SET `sit_inforpgfc`='fechado',`data_fechamento_inforpgfc`=CURDATE(),`obs_inforpgfc`=CONCAT('PAGAMENTO + DESCONTO EFETUADO DE R$ ',valorpago) WHERE `sit_inforpgfc`='aberto' AND `id_cliente_inforpgfc`=id_cliente AND `valor_inforpgfc` <= valorpago; 
		UPDATE `fc_inforpg` SET `sit_inforpgfc`='aberto',`datatime_inforpgfc`=NOW(),`obs_inforpgfc`=CONCAT('PAGAMENTO + DESCONTO EFETUADO DE R$ ',valorpago) WHERE `sit_inforpgfc`='agendado' AND `id_cliente_inforpgfc`=id_cliente AND `valor_agendamento_inforpgfc` <= valorpago;
	END IF;
END$$

DROP PROCEDURE IF EXISTS `AltSituacao`$$
CREATE DEFINER=`provedor`@`localhost` PROCEDURE `AltSituacao` ()  NO SQL
BEGIN
	  	declare done INT DEFAULT 0;
	declare qtd_bl INT DEFAULT 0;
    declare qtd_db INT DEFAULT 0;
    declare qtd_ca INT DEFAULT 0;
    declare qtd_at INT DEFAULT 0;
  	declare ID INT;
    declare CONTA INT;
  	declare PROVEDOR INT;
  	declare ACAO VARCHAR(50);
  	declare MOTIVO VARCHAR(255);
  	declare RESULTADO VARCHAR(255);
	 	 			DECLARE curs CURSOR FOR (
		SELECT id_situacao,codigo_cliente_situacao,acao_situacao,codigo_provedor FROM sis_clientes_situacao WHERE sit_acao_situacao = 'AGENDADO' AND data_acao_situacao <= curdate()
	);
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
 	  	OPEN curs;
	 		  	REPEAT FETCH curs INTO ID, CONTA, ACAO, PROVEDOR;
				IF NOT done THEN 
			CASE ACAO
				WHEN 'bloquear' THEN 
				    UPDATE sis_clientes_dados SET sit_clientes='BL',id_situacao_clientes=ID WHERE codigo_clientes=CONTA AND codigo_provedor = PROVEDOR;
				    SET MOTIVO='bloqueio';
					SET qtd_bl=qtd_bl+1;
				WHEN 'desbloquear' THEN 
					UPDATE sis_clientes_dados SET sit_clientes='AT',id_situacao_clientes=ID WHERE codigo_clientes=CONTA AND codigo_provedor = PROVEDOR;
					SET MOTIVO='desbloqueio';
					SET qtd_db=qtd_db+1;
				WHEN 'cancelar' THEN 
					UPDATE sis_clientes_dados SET sit_clientes='CA',id_situacao_clientes=ID WHERE codigo_clientes=CONTA AND codigo_provedor = PROVEDOR;
					UPDATE sis_dados_macs SET sit_macs='des' WHERE codigo_macs=CONTA AND codigo_provedor = PROVEDOR;
					SET MOTIVO='cancelamento';
					SET qtd_ca=qtd_ca+1;
				WHEN 'ativar' THEN 
					UPDATE sis_dados_pessoais SET sit_cadastro_pessoais='espera', origem_cadastro_pessoais='realivar' WHERE codigo_pessoais=CONTA AND codigo_provedor = PROVEDOR;
					SET MOTIVO='Ativamento';
					SET qtd_at=qtd_at+1;
				ELSE
					BEGIN
                    	SET MOTIVO='';
					END;
			END CASE;
						UPDATE sis_clientes_situacao SET sit_acao_situacao='EXECUTADO', datatime_exe_situacao=NOW() WHERE id_situacao = ID AND codigo_provedor = PROVEDOR;
						CALL logoutOn(CONTA,MOTIVO);
					END IF;
	  		  	UNTIL done END REPEAT;
	 	  	CLOSE curs;
		SET RESULTADO = CONCAT('Bloqueados:',qtd_bl,'Desbloqueados:',qtd_db,'Cancelados:',qtd_ca,'Ativados:',qtd_at);
	END$$

