DROP PROCEDURE IF EXISTS `autoDesbloqueio`$$
CREATE DEFINER=`provedor`@`localhost` PROCEDURE `autoDesbloqueio` ()  NO SQL
BEGIN
	  	declare done INT DEFAULT 0;
	declare EXE VARCHAR(2);
	declare ALT VARCHAR(2);
  	declare DTBL VARCHAR(50);
	declare MOTIVO VARCHAR(255);
    declare CONTA INT;
	declare ICV INT;
  	declare PROVEDOR INT;
	declare PVS FLOAT;
	declare TVR FLOAT;
	declare TVD FLOAT;
	declare RDP FLOAT;
	 	 			DECLARE curs CURSOR FOR (
		SELECT codigo_clientes, data_acao_situacao, porcentagem_vinculada_situacao, id_cobranca_vinculada_situacao, sis_clientes_dados.codigo_provedor FROM sis_clientes_dados INNER JOIN sis_clientes_situacao ON sis_clientes_situacao.id_situacao=sis_clientes_dados.id_situacao_clientes WHERE sit_clientes='BL' AND tipo_motivo_acao_situacao='atraso'
	);
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
 	  	OPEN curs;
	 		  	REPEAT FETCH curs INTO CONTA, DTBL, PVS, ICV, PROVEDOR;
				IF NOT done THEN
			IF (ICV = 0) THEN
								SET TVR=(SELECT IFNULL(SUM(valor_recebimentos),0) FROM sis_recebimentos WHERE datatime_recebimentos > DTBL AND codigo_pessoais_recebimentos=CONTA AND codigo_provedor=PROVEDOR);
				SET TVD=(SELECT IFNULL(SUM(valor_cobdeb),0) FROM sis_cobrancas_debitos WHERE sit_cobdeb='vc' AND codigo_conta_cobdeb=CONTA AND codigo_provedor=PROVEDOR);
				SET RDP=(TVR+TVD)*PVS;
																IF (RDP < TVR) THEN
					SET EXE='on';
					SET MOTIVO='Pagou total ou minimo necessario';
				ELSE
					SET EXE='';
				END IF;
			ELSE
				IF ((SELECT sit_recebimento_cobrancas FROM sis_dados_cobrancas WHERE id_cobrancas=ICV AND situacao_cobrancas='PAGA' AND codigo_provedor=PROVEDOR) = 'TOTAL') THEN
					SET EXE='on';
					SET MOTIVO='Pagou cobranca determinada';			
				ELSE
					SET EXE='';
				END IF;
			END IF;
			IF (EXE = 'on') THEN
				SELECT CONTA, NOW(), 'desbloquear', 'auto', curdate(), MOTIVO, 'AGENDADO', PROVEDOR FROM DUAL WHERE NOT EXISTS (SELECT codigo_cliente_situacao, datatime_situacao, acao_situacao, tipo_acao_situacao, data_acao_situacao, motivo_acao_situacao, sit_acao_situacao, codigo_provedor FROM sis_clientes_situacao WHERE codigo_cliente_situacao=CONTA AND sit_acao_situacao='AGENDADO' AND acao_situacao='desbloquear' AND codigo_provedor=PROVEDOR);
								SET ALT='on';
				call AltSituacao();
 			END IF;
					END IF;
	  		  	UNTIL done END REPEAT;
	 	  	CLOSE curs;
		IF (ALT = 'on') THEN
		call AltSituacao();
 	END IF;
	END$$

