DROP PROCEDURE IF EXISTS `exe_bloqueio_desbloqueio`$$
CREATE DEFINER=`provedor`@`localhost` PROCEDURE `exe_bloqueio_desbloqueio` (IN `tipo` VARCHAR(10), IN `id` INT, IN `id_cliente` INT, IN `provedor` INT)  BEGIN
	declare sit VARCHAR(20);
	IF ( tipo = 'bloquear' ) THEN 
		SET sit='bloqueado';
		UPDATE `mk_secretpp` SET `profile_save_secretpp`=`profile_secretpp`,`profile_secretpp`='bloqueados',`tipo_secretpp`='atz' WHERE `id_cliente_secretpp`=id_cliente;
	ELSE
        	SET sit='ativo';
		UPDATE `mk_secretpp` SET `profile_save_secretpp`=`profile_secretpp`,`profile_secretpp`=`profile_at_secretpp`,`tipo_secretpp`='atz' WHERE `id_cliente_secretpp`=id_cliente;
	END IF;
	UPDATE `fc_clientes` SET `sit_clientesfc`=sit WHERE `id_clientesfc`=id_cliente;
END$$

