DROP PROCEDURE IF EXISTS `logoutOn`$$
CREATE DEFINER=`provedor`@`localhost` PROCEDURE `logoutOn` (IN `CONTA` INT, IN `MOTIVO` VARCHAR(50))  NO SQL
BEGIN
	  	declare done INT DEFAULT 0;
  	declare PROVEDOR INT;
    declare ID_PLANO INT;
  	declare LOGIN VARCHAR(255);
    declare NOME VARCHAR(255);
    declare PLANO VARCHAR(255);
    declare nome_plano VARCHAR(255);
    declare down_plano VARCHAR(255);
    declare up_plano VARCHAR(255);
    declare valor_plano VARCHAR(255);
    declare IP VARCHAR(255);
    declare SIT VARCHAR(255);
    declare type VARCHAR(255);
    declare TIPO VARCHAR(255);
    declare STATS VARCHAR(255);
  	declare ROUTER VARCHAR(255);
  	declare MK VARCHAR(255);
  	declare SERVICO VARCHAR(255);
  	declare COMANDOS longtext;
	declare DADOSMD5 VARCHAR(255);
	     	 			DECLARE curs CURSOR FOR (
		SELECT login_status,tipo_status,user_status,servidor_online_status,ip_online_status,codigo_provedor FROM sis_usuarios_status WHERE (tipo_status = 'ipbinding' OR user_status = 'ON') AND codigo_user_status = CONTA
    );
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
 		OPEN curs;
		REPEAT FETCH curs INTO LOGIN, TIPO, STATS, ROUTER, IP, PROVEDOR;
				IF NOT done THEN
			            IF (ROUTER != '') THEN
				SET MK=SPLIT_STRING(ROUTER, '-', 2);
				SET SERVICO=SPLIT_STRING(SPLIT_STRING(ROUTER, '-', 1), '_',2);
            ELSE
            	SET SERVICO=TIPO;
            END IF;
						IF (SERVICO = 'HP') THEN
				SET COMANDOS=CONCAT('/ip hotspot active remove [find user=',LOGIN,'];');
			ELSEIF (SERVICO = 'ipbinding') THEN
            	IF (STATS = 'OFF') THEN
                	SET IP=(SELECT ip_user FROM sis_dados_user WHERE login_user=LOGIN AND codigo_provedor=PROVEDOR);
                    SET MK=CONCAT('mk_',(SELECT nome_mk FROM sis_servidor_mikrotiks WHERE id_mk=(SELECT mk_user FROM sis_dados_user WHERE login_user=LOGIN AND codigo_provedor=PROVEDOR)));
                END IF;
            	IF (MOTIVO = 'bloqueio') THEN
                	SET COMANDOS=CONCAT('/ip hotspot ip-binding set [ find where address=',IP,'] type=blocked;');
                ELSEIF (MOTIVO = 'desbloqueio') THEN
               		SET COMANDOS=CONCAT('/ip hotspot ip-binding set [ find where address=',IP,'] type=bypassed;');
                ELSEIF (MOTIVO = 'adicionar') THEN
                	SET NOME=(SELECT nome_pessoais FROM sis_dados_pessoais WHERE codigo_pessoais=CONTA AND codigo_provedor=PROVEDOR);
                    SET SIT=(SELECT sit_clientes FROM sis_clientes_dados WHERE codigo_clientes=CONTA AND codigo_provedor=PROVEDOR);
                    IF (SIT = 'AT') THEN
                    	SET type='bypassed';
                    ELSE
                    	SET type='blocked';
                    END IF;
                    SET ID_PLANO=(SELECT cod_servicos_alocados FROM sis_servicos_alocados WHERE codigo_clientes_alocados=CONTA AND codigo_provedor=PROVEDOR);
                    SET PLANO=(SELECT CONCAT(nome_servicos,'|',	download_servicos_planos,'|',upload_servicos_planos,'|',valor_servicos) FROM sis_servicos WHERE id_servicos=ID_PLANO);
                    SET nome_plano=SPLIT_STRING(PLANO,'|',1);
                    SET down_plano=SPLIT_STRING(PLANO,'|',2);
                    SET up_plano=SPLIT_STRING(PLANO,'|',3);
                    SET valor_plano=SPLIT_STRING(PLANO,'|',4);
               		SET COMANDOS=CONCAT(':if ([/ip hotspot ip-binding find address="',IP,'"]="") do={/ip hotspot ip-binding add address="',IP,'" to-address="',IP,'" comment="',NOME,' - ',nome_plano,'" type="',type,'";} else={/ip hotspot ip-binding set [find address="',IP,'"] to-address="',IP,'" comment="',NOME,' - ',nome_plano,'" type="',type,'";};:if ([/queue simple find name="',IP,'"]="") do={/queue simple add name="',IP,'" target-addresses="',IP,'" comment="',NOME,' - ',nome_plano,' - R$ ',valor_plano,'";} else={/queue simple set [find name="',IP,'"] name="',IP,'" target-addresses="',IP,'" comment="',NOME,' - ',nome_plano,' - R$ ',valor_plano,'";}');
                ELSEIF (MOTIVO = 'desativar') THEN
               		SET COMANDOS=CONCAT(':if ([/ip hotspot ip-binding find address="',IP,'"]="") do={/ip hotspot ip-binding set [find address="',IP,'"] disabled=yes;};:if ([/queue simple find name="',IP,'"]="") do={/queue simple set [find name="',IP,'"] disabled=yes;};');
                ELSE
					SET COMANDOS=CONCAT('/ip hotspot host remove [find address=',IP,'];');
                END IF;
			ELSE
				SET COMANDOS=CONCAT('/ppp active remove [find name=',LOGIN,'];');
			END IF;
			            IF (PROVEDOR != '' AND MK != '' AND COMANDOS != '') THEN
            	CALL mkComands(PROVEDOR,MK,COMANDOS,MOTIVO);
            END IF;
					END IF;
	  		UNTIL done END REPEAT;
	  	CLOSE curs;
	END$$

