	declare newData date;
	declare i int(3) default 0;
	SET newData = data_i;
    WHILE(diasuteis>i) DO
		SET newData = DATE_ADD(newData, INTERVAL 1 DAY);
      	IF (DIA_UTIL(newData,cidade,uf)) THEN
        	SET i = i+1;
        END IF;
	END WHILE;
	RETURN newData;
END$$

DROP FUNCTION IF EXISTS `DATA_PASCOA`$$
CREATE DEFINER=`provedor`@`localhost` FUNCTION `DATA_PASCOA` (`ano` INT) RETURNS DATE NO SQL
BEGIN
	  	declare A INT;
    declare M INT; 
    declare D INT;  
    declare C INT;  
    declare I INT;  
    declare J INT;  
    declare K INT;  
    declare L INT;  
    declare N INT;
		SET A = ano;
		SET C = TRUNCATE(A/100,0);
	SET N = A-(19*TRUNCATE(A/19,0));
	SET K = TRUNCATE((C-17)/25,0);
	SET I = C-TRUNCATE(C/4,0)-TRUNCATE((C-K)/3,0)+19*N+15;
	SET I = I-30*(TRUNCATE(I/30,0));
	SET I = I-(TRUNCATE(I/28,0))*(1-(TRUNCATE(1/28,0))*(TRUNCATE(29/(I+1),0))*(TRUNCATE((21-N)/11,0)));
	SET J = A+TRUNCATE(A/4,0)+I+2-C+TRUNCATE(C/4,0);
	SET J = J-7*TRUNCATE(J/7,0);
	SET L = I-J;
	SET M = 3+TRUNCATE((L+40)/44,0);
	SET D = L+28-(31*TRUNCATE(M/4,0));
	RETURN (STR_TO_DATE(CONCAT(LPAD(A, 4, 0),'-',LPAD(M, 2, 0),'-',LPAD(D, 2, 0)), '%Y-%m-%d'));
END$$

