DROP FUNCTION IF EXISTS `RETURN_COMANDOS_MK`$$
CREATE DEFINER=`provedor`@`localhost` FUNCTION `RETURN_COMANDOS_MK` (`acao` VARCHAR(50), `id_table` INT, `coment` VARCHAR(255)) RETURNS LONGTEXT CHARSET latin1 NO SQL
BEGIN
	declare COMANDOS_MK LONGTEXT;
