    IF(new.valor_desconto_caixafc IS NOT NULL) THEN
    	SET VALOR=(VALOR+new.valor_desconto_caixafc);
    END IF;
	IF(VALOR > 0 AND new.id_cliente_caixafc IS NOT NULL AND new.id_cliente_caixafc > 0 )THEN
		call auto_desbloqueio((new.valor_caixafc+new.valor_desconto_caixafc),new.id_cliente_caixafc);
  	END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `PG_UPDATE`;
DELIMITER $$
CREATE TRIGGER `PG_UPDATE` AFTER UPDATE ON `fc_caixa` FOR EACH ROW BEGIN
	DECLARE SAC boolean;
	DELETE FROM `fc_itens` WHERE `id_pagamento_itensfc`=new.id_caixafc;
		SET SAC=(SELECT ADD_CREDITOS(new.id_caixafc, new.id_cliente_caixafc, new.data_caixafc, new.id_provedor));
	IF (new.id_cliente_caixafc!=0) THEN
		call salva_encargos(new.id_cliente_caixafc);
    END IF;
	call altera_inforpg(new.id_cliente_caixafc);
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `PG_UPDATE_B`;
DELIMITER $$
CREATE TRIGGER `PG_UPDATE_B` BEFORE UPDATE ON `fc_caixa` FOR EACH ROW BEGIN
    declare PAGO FLOAT;
    SET PAGO=((new.valor_caixafc+new.valor_desconto_caixafc)-(old.valor_caixafc+old.valor_desconto_caixafc));
    IF(PAGO>0 AND new.id_cliente_caixafc>0) THEN
        call auto_desbloqueio(PAGO,new.id_cliente_caixafc);
    END IF;
END
$$
DELIMITER ;

