DROP TRIGGER IF EXISTS `ALTERA_END_MENSALFC`;
DELIMITER $$
CREATE TRIGGER `ALTERA_END_MENSALFC` AFTER UPDATE ON `fc_clientes` FOR EACH ROW BEGIN
	IF (new.end1_clientesfc!=old.end1_clientesfc OR new.num1_clientesfc!=old.num1_clientesfc OR new.bar1_clientesfc!=old.bar1_clientesfc OR new.cid1_clientesfc!=old.cid1_clientesfc OR new.uf1_clientesfc!=old.uf1_clientesfc OR
new.cep1_clientesfc!=old.cep1_clientesfc OR
new.comp1_clientesfc!=old.comp1_clientesfc OR new.lat1_clientesfc!=old.lat1_clientesfc OR new.long1_clientesfc!=old.long1_clientesfc) THEN
        UPDATE `fc_sevmensal` SET `end_sevmensalfc`=CONCAT(new.end1_clientesfc,', ',new.num1_clientesfc,' - ',new.bar1_clientesfc,' - ',new.cid1_clientesfc,'-',new.uf1_clientesfc), `cep_sevmensalfc`=new.cep1_clientesfc, `comp_sevmensalfc`=new.comp1_clientesfc, `lat_sevmensalfc`=new.lat1_clientesfc, `lon_sevmensalfc`=new.long1_clientesfc WHERE `id_cliente_mensalfc`=new.id_clientesfc AND `end_cob_sevmensalfc`='on';
	END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `DELETA_DADOS`;
DELIMITER $$
CREATE TRIGGER `DELETA_DADOS` BEFORE DELETE ON `fc_clientes` FOR EACH ROW BEGIN
    DELETE FROM `fc_bloqueios` WHERE `id_cliente_bloqueiosfc`=old.id_clientesfc;
    DELETE FROM `fc_boletos` WHERE `id_clientes_boletosfc`=old.id_clientesfc;
    DELETE FROM `fc_encargos` WHERE `id_cliente_encargosfc`=old.id_clientesfc;
    DELETE FROM `fc_inforpg` WHERE `id_cliente_inforpgfc`=old.id_clientesfc;    
    DELETE FROM `fc_itens` WHERE 
`id_cliente_itensfc`=old.id_clientesfc;
    DELETE FROM `fc_pontos` WHERE `id_cliente_pontosfc`=old.id_clientesfc;
    DELETE FROM `fc_sevmensal` WHERE `id_cliente_mensalfc`=old.id_clientesfc;
    DELETE FROM `fc_vendas` WHERE `id_cliente_vendasfc`=old.id_clientesfc;
END
$$
DELIMITER ;

