-- Gatilhos `fc_sevmensal`
--
DROP TRIGGER IF EXISTS `DELETE_SERVMENSAL`;
DELIMITER $$
CREATE TRIGGER `DELETE_SERVMENSAL` AFTER DELETE ON `fc_sevmensal` FOR EACH ROW BEGIN
	IF(old.id_cliente_mensalfc>0) THEN
        UPDATE `fc_clientes` SET `sit_clientesfc`='inativo' WHERE `sit_clientesfc`!='inativo' AND `id_clientesfc`=old.id_cliente_mensalfc;
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `INSERT_SERVMENSAL`;
DELIMITER $$
CREATE TRIGGER `INSERT_SERVMENSAL` AFTER INSERT ON `fc_sevmensal` FOR EACH ROW BEGIN
	DECLARE COMENT VARCHAR(255);
	IF(NEW.id_cliente_mensalfc>0) THEN
        UPDATE `fc_clientes` SET `sit_clientesfc`='ativo' WHERE `sit_clientesfc`='inativo' AND `id_clientesfc`=NEW.id_cliente_mensalfc;    
        --         CALL gera_faturas(NEW.id_cliente_mensalfc,'');
    END IF;
	IF(NEW.id_user_sevmensalfc>0 AND NEW.cadastro_mensalfc!='on') THEN
    	SET COMENT=NEW_COMMENT(NEW.id_cliente_mensalfc,NEW.id_user_sevmensalfc);
		UPDATE `mk_secretpp` SET `id_cliente_secretpp`=NEW.id_cliente_mensalfc, `comment_secretpp`=COMENT,`tipo_secretpp`=IF(`salvo_secretpp`='on','atz','new'),`id_provedor`=NEW.id_provedor WHERE `id_secretpp`=NEW.id_user_sevmensalfc AND `id_cliente_secretpp`=0;
        --  	END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `UPDATE_SERVMENSAL`;
DELIMITER $$
CREATE TRIGGER `UPDATE_SERVMENSAL` AFTER UPDATE ON `fc_sevmensal` FOR EACH ROW BEGIN
	IF(NEW.id_user_sevmensalfc!=OLD.id_user_sevmensalfc AND NEW.id_user_sevmensalfc>0) THEN
		UPDATE `mk_secretpp` SET `id_cliente_secretpp`=NEW.id_cliente_mensalfc, `tipo_secretpp`=IF(`salvo_secretpp`='on','atz','new'), `id_provedor`=NEW.id_provedor WHERE `id_secretpp`=NEW.id_user_sevmensalfc;
        --  	END IF; 
END
$$
DELIMITER ;

