    declare ID INT;
    declare NEW VARCHAR(255);
    IF(new.tipo_secretpp='new') THEN
		CALL new_comand_mk('add-secrets-pppoe',new.id_secretpp,new.mk_secretpp,new.id_provedor,'');
	END IF;
    SET NEW=(SELECT SPLIT_STRING(new.atz_comment_secretpp,'#',1));
    IF(NEW=0 AND new.id_cliente_secretpp=0) THEN
     	CALL new_cadastro(new.atz_comment_secretpp,new.id_secretpp,new.id_provedor);
    END IF;
END
$$
DELIMITER ;
DROP TRIGGER IF EXISTS `UPDATE_AFTER_SECRETPP`;
DELIMITER $$
CREATE TRIGGER `UPDATE_AFTER_SECRETPP` AFTER UPDATE ON `mk_secretpp` FOR EACH ROW BEGIN
	declare ACAO VARCHAR(10);
    IF (new.no_save_secretpp!='on') THEN
        IF (new.tipo_secretpp!='') THEN
            SET ACAO=new.tipo_secretpp;
            IF(ACAO='new') THEN
                CALL new_comand_mk('add-secrets-pppoe',new.id_secretpp,new.mk_secretpp,new.id_provedor,'');
            ELSEIF(ACAO='atz') THEN
                CALL new_comand_mk('set-secrets-pppoe',new.id_secretpp,new.mk_secretpp,new.id_provedor,'');
                IF(new.profile_secretpp!=old.profile_secretpp ) THEN
                    CALL new_comand_mk('remove-active-pppoe',new.id_secretpp,new.mk_secretpp,new.id_provedor,'');
                END IF;
            ELSEIF(ACAO='del') THEN
                CALL new_comand_mk('remove-secrets-pppoe',new.id_secretpp,new.mk_secretpp,new.id_provedor,'');
            ELSEIF(ACAO='off') THEN
                CALL new_comand_mk('remove-active-pppoe',new.id_secretpp,new.mk_secretpp,new.id_provedor,'');
            END IF;
        END IF;
   	END IF;
END
$$
DELIMITER ;
