re ((`x`.`tipo_caixafc` = 'in') and (`x`.`id_cliente_caixafc` <> 0) and (`x`.`cancelado_caixafc` <> 'on')) group by `x`.`id_cliente_caixafc`,date_format(`x`.`data_caixafc`,'%Y-%m') ;

